<script>

  var currentYear = new Date().getFullYear();
  document.getElementById("year").innerHTML = currentYear;

function getUniqueElements(n){const t=[];for(let e=0;e<n.length;e++)t.includes(n[e])||t.push(n[e]);return t}
var drag = d3.behavior.drag().on("dragstart", dragstarted).on("drag", dragged).on("dragend", dragended);				
function dragstarted(a){d3.event.sourceEvent.stopPropagation();d3.select(this).classed("dragging",!0)};
function dragged(a){a=d3.select(this);var b=d3.transform(a.attr("transform")).translate[0],c=d3.transform(a.attr("transform")).translate[1];a.attr("transform","translate("+(b+d3.event.dx)+","+(c+d3.event.dy)+")")};
function dragended(a){d3.select(this).classed("dragging",!1)};

var compoundorcomb = "single";
$("#compsel").click(function() {
	compoundorcomb = "single"; $("#combiselections").hide(); $("#singleselections").show();
	$("#compsel").css({"font-weight": "bold", "text-decoration": "underline", "text-decoration-style": "wavy", "text-decoration-thickness": "0.7px"});
	$("#combsel").css({"font-weight": "", "text-decoration": "", "text-decoration-style": "", "text-decoration-thickness": ""});
	reDrawHeatmap();
})
$("#combsel").click(function() {
	compoundorcomb = "combi"; $("#combiselections").show(); $("#singleselections").hide();
	$("#combsel").css({"font-weight": "bold", "text-decoration": "underline", "text-decoration-style": "wavy", "text-decoration-thickness": "0.7px"});
	$("#compsel").css({"font-weight": "", "text-decoration": "", "text-decoration-style": "", "text-decoration-thickness": ""});
	reDrawHeatmap();
})

checkedId = "optionheat"
$('.radiobuts').on('change', function() {
  if ($(this).is(':checked')) {
    checkedId = $(this).attr('id');
	//console.log(checkedId);
	reDrawHeatmap()
  }
