function sortByValues(g, m, n) {
    var c = svg.transition().duration(1E3),
        e = [];
    d3.selectAll(".c" + g + m).filter(function(k) {
        0 != k ? e.push(k) : e.push(-999)
    });
    if ("r" == g) {
        var l = d3.range(col_number).sort(function(k, c) {
            return n ? e[c] - e[k] : e[k] - e[c]
        });
        c.selectAll(".cell").attr("x", function(k) {
            k = parseInt(d3.select(this).attr("col"));
            return l.indexOf(k) * cellSize
        });
        c.selectAll(".colLabel").attr("y", function(k, c) {
            return l.indexOf(c) * cellSize
        }).attr("transform", function(c, e) {
            return "translate(" + cellSize / 2 + ", -3) rotate(-90) rotate(45, 0, " +
                l.indexOf(e) * cellSize + ")"
        })
    } else l = d3.range(row_number).sort(function(c, g) {
        return n ? e[g] - e[c] : e[c] - e[g]
    }), c.selectAll(".cell").attr("y", function(c) {
        c = parseInt(d3.select(this).attr("row"));
        return l.indexOf(c) * cellSize
    }), c.selectAll(".rowLabel").attr("y", function(c, e) {
        return l.indexOf(e) * cellSize
    }).attr("transform", function(c, e) {
        return "translate(-3," + cellSize / 1.5 + ")"
    })
}

