let exampleIndex = 0;
let typingTimeout;
let typingIndex = 0;

function typeExample() {
  if (typingIndex < examples[exampleIndex].length) {
    inputSMILES.setAttribute(
      'placeholder',
      inputSMILES.getAttribute('placeholder') + examples[exampleIndex][typingIndex]
    );
    typingIndex++;
    typingTimeout = setTimeout(typeExample, 50); // Type next character after 100ms
  } else {
    setTimeout(() => {
      inputSMILES.setAttribute('placeholder', '');
      exampleIndex = (exampleIndex + 1) % examples.length;
      typingIndex = 0;
      setTimeout(updatePlaceholder, 700); // Wait 2 seconds before typing the next example
    }, 700);
  }
}

function updatePlaceholder() {
  typeExample();
}

const updateInterval = 0;
